import React from 'react';
import ReactDOM from "react-dom";
import './client.css';
import ClientHome from './ClientHome';

function ClientDashboard() {
    function handleClick(event) {
        console.log(event.target.id);

        ReactDOM.render(<ClientHome />, document.getElementById("content-part"));
    }
    return (
        <div className='container'>
            <aside className="sidenav">
                <img src="dist/img/PrakriaLogo_Final.png" alt="Prakria Direct Logo" className='Logo' />
                <button className='create-btn'>Create a project</button>
                <nav className='nav-menu'>
                    <ul>
                        <li id="project" onClick={(e) => this.handleClick(e)}>Projects</li>
                        <li>Brands</li>
                        <li>Files</li>
                        <li>Add a Resource</li>
                        <li>Account</li>
                        <li>Logout</li>
                    </ul>
                </nav>
            </aside>
            <div id="content-part">
                <ClientHome />
            </div>
            <aside className="control-sidebar control-sidebar-dark">
            </aside>
        </div>
    );
}

export default ClientDashboard;
